import React from 'react'
import Image from './Image'
import LazyLoad from 'react-lazyload';

const LazyImage = (props) => (
    <LazyLoad height={ 200 } offset={ 100 }>
        <Image {...props}/>
    </LazyLoad>
)

export default LazyImage;
